const initialState = {
	val_five: 1
}

export const multiplyFive = () => {
	return {
		type: MULTIPLY_FIVE
	}
}

const FiveReducer = (state = initialState, action) => {
	switch(action.type){
		case MULTIPLY_FIVE:
            return {
			...state,
			val_five: state.val_five * 5
		}		
		default: 
        return state
	}
}

const store = combineReducers({
	five: FiveReducer
})



